#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ns:m.06x5s ns:sports.sports_championship.events ?x . # Super Bowl
  {
    { ?x ns:sports.sports_championship_event.runner_up ns:m.0ws7 . } # Arizona Cardinals 
    UNION
    { ?x ns:sports.sports_championship_event.champion ns:m.0ws7 . } # Arizona Cardinals 
  }
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
  {
    ns:m.01ct6 ns:american_football.football_team.current_head_coach ?x .
  }
  UNION
  {
    ns:m.01ct6 ns:sports.sports_team.coaches ?y .
	?y ns:sports.sports_team_coach_tenure.coach ?x .
	?y ns:sports.sports_team_coach_tenure.position ns:m.02y5kn . #coach
  }
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ns:m.0l6c9 ns:tennis.tennis_tournament.match_results ?y . # The US Open (Tennis)
  ?y ns:tennis.tennis_match.date ?x ;
     ns:tennis.tennis_match.match_format ns:m.04hdtlb .  # Men's singles
  FILTER (xsd:dateTime(?x) - xsd:dateTime("2011-01-01") >= 0)
  FILTER (xsd:dateTime(?x) - xsd:dateTime("2011-12-31") <= 0)
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x 
WHERE {
	FILTER (?x != ns:m.0b90_r)
	{ 
	  ns:m.0b90_r ns:location.statistical_region.places_exported_to ?y .
	  ?y ns:location.imports_and_exports.exported_to ?x . 
	}
	UNION
	{
	  ns:m.0b90_r ns:location.statistical_region.places_imported_from ?y .
	  ?y ns:location.imports_and_exports.imported_from ?x . 
	}
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ns:m.03cv24 ns:organization.organization.date_founded	?d . # United States Department of the Navy
  ns:m.060d2 ns:government.government_office_or_title.office_holders ?y . # President of the United States
  ?y ns:government.government_position_held.from ?from ;
     ns:government.government_position_held.to ?to ;
     ns:government.government_position_held.office_holder ?x .
  FILTER(xsd:dateTime(?from) - xsd:dateTime(?d) <= 0)
  FILTER(xsd:dateTime(?to) - xsd:dateTime(?d) >= 0)
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
FILTER (?x != ns:m.07t21)
FILTER (!isLiteral(?x) OR (lang(?x) = '' OR lang(?x) = 'en'))
ns:m.07t21 ns:location.location.adjoin_s ?y .
?y ns:location.adjoining_relationship.adjoins ?x .
{ {?x ns:common.topic.notable_types ns:m.01mp .} UNION {?x ns:common.topic.notable_types ns:m.01y2jks .} }
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  FILTER (?x != ns:m.02mjmr)
  ns:m.02mjmr ns:government.politician.government_positions_held ?y .
  ?y ns:government.government_position_held.office_position_or_title ?x ;
     ns:government.government_position_held.to ?d .  # the position has ended; not the current position
}
